import React from 'react';

function Map() {
  return (
    <div className="jumbotron jumbotron-fluid">
      <div className="container">
        <h1 className="display-4">Google Map</h1>
        <p className="lead">We could put the Map here</p>
      </div>
    </div>
  )
}

export default Map;
